fn main() {
    let input: Vec<u8> = "".into();
    let mut left = 0;
    let mut right = 13;
    let mut finished = false;
    while !finished {
        finished = true;
        for i in left..right {
            for j in ((i+1)..=right).rev() {
                if input[i] == input[j] {
                    left = i + 1;
                    right = i + 14;
                    finished = false;
                    break;
                }
            }
            if !finished {
                break;
            }
        }
    }
    println!("{}", right + 1);
}
